script: |
  super -f text -I q10248.spq | sort > q10248.out

inputs:
  - name: q10248.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE - col0 NOT BETWEEN + 97 AND - + col1 * + CAST ( NULL AS REAL ) + col0 + 0 * + 21 * col0 * - col2;
  - name: tab2

outputs:
  - name: q10248.out
    data: |
      46	51	23
      64	77	40
      75	67	58
